const generateNames = () => {
  const generatedNames = [];
  for (let i = 0; i < 10; i++) {
    const randomGenderIndex = Math.floor(Math.random() * 2); // 0 or 1 for male or female
    const randomRaceIndex = Math.floor(Math.random() * races.length);
    const randomCultureIndex = Math.floor(Math.random() * cultures.length);

    const randomGender = randomGenderIndex === 0 ? 'male' : 'female';
    const randomRace = races[randomRaceIndex];
    const randomCulture = cultures[randomCultureIndex];

    generatedNames.push({
      gender: randomGender,
      race: randomRace,
      culture: randomCulture
    });
  }
  console.log(generatedNames); // For debugging
  // Set generated names state or perform any other logic with the generated names
};
